import React from "react";
import NavBarItem from "./NavBarItem";
import "./NavBar.css";

const NavBar = (props) => {
  const data = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  return (
    <ul>
      <NavBarItem></NavBarItem>
    </ul>
  );
};

export default NavBar;
